import PropTypes from 'prop-types'


const Header = ({title}) => {
  return (
    <header>
      <h1>Task Management System</h1>
      <h1>{title}</h1>
    </header>
  )
}

Header.defaultProps = {
    title: 'Task Tracker'
};

PropTypes = { 
    title: PropTypes.string.isRequired,
};

export default Header
